    //点击水龙头，水漫出
    clickSwitch() {
        this.switch_a.on('pointerdown', () => {
            setTimeout(() => {
                clearInterval(this.switch_interval)
                this.switch_a.scaleX = 0
                this.switch_a.scaleY = 0
                this.switch_b.scaleX = 0
                this.switch_b.scaleY = 0
                this.sink_n.visible = 0
                this.sink_a.visible = 1
            }, 300);
            setTimeout(() => {
                this.sink_b.visible = 1

            }, 800);
            setTimeout(() => {
                this.sink_c.visible = 1
                this.key.visible = 1
                this.tweens.add({
                    targets: [this.key],
                    angle: 150,
                    y: 600,
                    duration: 500,
                    callbackScope: this,
                    onComplete: () => {
                        this.tweens.add({
                            targets: [this.key],
                            angle: 90,
                            duration: 100,
                            callbackScope: this,
                            onComplete: () => {
                                this.clickKey()
                            }
                        })
                    }
                })
            }, 1200);
        }, this)
        this.switch_b.on('pointerdown', () => {
            setTimeout(() => {
                clearInterval(this.switch_interval)
                this.switch_a.scaleX = 0
                this.switch_a.scaleY = 0
                this.switch_b.scaleX = 0
                this.switch_b.scaleY = 0
                this.sink_n.visible = 0
                this.sink_a.visible = 1
            }, 300);
            setTimeout(() => {
                this.sink_b.visible = 1

            }, 800);
            setTimeout(() => {
                this.sink_c.visible = 1
                this.key.visible = 1
                this.tweens.add({
                    targets: [this.key],
                    angle: 150,
                    y: 600,
                    duration: 500,
                    callbackScope: this,
                    onComplete: () => {
                        this.tweens.add({
                            targets: [this.key],
                            angle: 90,
                            duration: 100,
                            callbackScope: this,
                            onComplete: () => {
                                this.clickKey()
                            }
                        })
                    }
                })
            }, 1200);
        }, this)
    }

